import axios from "axios";
import API_URL from "./backendConfig";

const getNewSongs = () => {
    return axios.post(API_URL + "getNewSongs")
        .then(response=>{
            return response.data
        })
        .catch(e => {
        console.log(e)
    });
};


const homepageService = {
    getNewSongs,

};

export default homepageService;
